import React from 'react';
import ReactDom from 'react-dom';

const myName = "Talha Bajwa";
const luckyNum = 10;

ReactDom.render(
  <>
    <h1>My name is {myName}.</h1>
    <h2>My lucky number is {luckyNum}. </h2>
    <h1>Netflix Series</h1>
  </>,
  document.getElementById('root')
);
